import React from "react";
import Navbar from './Navbar';
import howToPlay from './HowToPlay';
import Credits from './Credits';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/">
            <Navbar />
          </Route>
          <Route path="/howtoplay">
            <howToPlay />
          </Route>
          <Route path="/credits">
            <Credits />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
